import {React, useState} from "react";
import ContactMailIcon from '@mui/icons-material/ContactMail';
import DrawIcon from '@mui/icons-material/Draw';
import Topics from './Topics';

function Header(){
    const [Topicsview, setTopicsview] = useState(false);

    return <div>
      <header style={{ display: 'flex', alignItems: 'center' }}>
        <div style={{textAlign: 'center'}}>
          Note Board <DrawIcon />
        </div>
        <div style={{ marginLeft: 'auto', fontSize: '15px', display: 'flex', alignItems: 'center' }}>
          <ContactMailIcon style={{ marginRight: '5px' }} />
          <p style={{ margin: 0, marginRight: '20px' }}>gourav.oct@gmail.com</p>
          <button style={{backgroundColor: '#3f4c67'}}><p>About Project</p></button>
        </div>
      </header>
      <Topics />
    </div>
}
export default Header;
